import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'https://longfordchildcare.ie/wp-content/uploads/2016/04/CHILD-PLAYING-OUTSIDE.jpg',
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header',
    key: '1'
  },
  {
    src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRmFKQiJCcPVg3jIGmpazoEykk4k7Sn-zxtwqAkAIGUOBaE1tfO&s',
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header',
    key: '2'
  },
  {
    src: 'https://longfordchildcare.ie/wp-content/uploads/2016/04/CHILD-PLAYING-OUTSIDE.jpg',
    altText: 'Slide 3',
    caption: 'Slide 3',
    header: 'Slide 3 Header',
    key: '3'
  }
];

const Car = () => <UncontrolledCarousel items={items} />;

export default Car;
